INSERT INTO `ps_product_lang` VALUES (1,1,1,' <p align=\"justify\">Sklep =mlamp.pl= przedstawia lampę stołową z serii ASTRA, która łączy cechy klasycznej oprawy ze <strong>stylem glamour</strong>. Na smukłej podstawie w kolorze chromu umocowano tradycyjny abażur z białego materiału, który został ozdobiony uroczymi <strong>kryształkami na łańcuszkach</strong>. Ta elegancka oprawa wprowadzi do Twojego domu wyrafinowaną atmosferę luksusu. W sypialni stworzy przyjemny nastrój, rozjaśniając wnętrze <strong>migoczącą iluminacją</strong>, w salonie natomiast przyciągnie wzrok gości i domowników. Także w lokalach komercyjnych, takich jak hotele czy restauracje, sprawdzi się doskonale.</p> <p align=\"justify\">Oprawy doskonale prezentują się pojedynczo oraz jako instalacje świetlne, tworząc niesamowite efekty podkreślające wyjątkowy wystrój i charakter Twoich pomieszczeń.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal / tkanina / kryształ <br />Wykończenie: chrom <br />Kolor: biały - przezroczysty (MTM1953/1 WH) / czarny - przezroczysty (MTM1953/1 BK)</p> <p><strong>Wymiary:</strong> <br /> Wysokość całkowita : 45 cm <br /> Szerokość: 25 cm <br /> Regulacja kąta światła: nie <br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','abazurowa-lampa-glamour-astra-mtm1953-1-wh-italux-stojaca-lampka-nocna-stolowa-okragla-krysztalki-crystal-biala','','','','Abażurowa LAMPA glamour ASTRA MTM1953/1 WH Italux stojąca LAMPKA nocna stołowa okrągła kryształki crystal biała','','','',''),(2,1,1,' <p align=\"justify\">Oprawa wisząca z serii ISLA oferowanej w sklepie =mlamp.pl= spodoba się osobom poszukującym niecodziennych rozwiązań w kwestii oświetlenia. Ten <strong>szykowny żyrandol</strong> pasuje bowiem do wnętrz utrzymanych zarówno w stylistyce klasycznej, jak i <strong>glamour</strong> czy nowoczesnej. Imponujący, owalny abażur z białej przezroczystej tkaniny kryje w sobie miejsce na cztery źródła światła oraz ozdoby w formie <strong>kryształowych zwisów-sopli </strong>. Rozjaśni każde pomieszczenie mieszkalne czy komercyjne dodając mu niepowtarzalnego charakteru.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal | szkło | tkanina <br />Kolor: biały</p> <p><strong>Wymiary:</strong> <br /> Wysokość całkowita (regulowana): do 100 cm <br /> Szerokość: 70 cm x 18 cm <br />Wysokość oprawy bez zawieszenia: 24 cm<br />Szerokość podsufitki: 44 cm x 4,5 cm <br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 4 x E14 / 230V / max 40W (łącznie 160W) <br />Możliwość zastosowania żarówek energooszczędnych lub LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','abazurowa-lampa-glamour-isla-mdm1870-4-wh-italux-klasyczna-oprawa-krysztalowy-zwis-zyrandol-szklany-crystal-bialy','','','','Abażurowa LAMPA glamour ISLA MDM1870-4 WH Italux klasyczna OPRAWA kryształowy ZWIS żyrandol szklany crystal biały','','','',''),(3,1,1,' <p align=\"justify\"><strong>Kinkiet</strong> z serii LANA dostępnej w sklepie =mlamp.pl= to świeże spojrzenie na styl klasyczny i uzupełnienie go paroma drobiazgami, zmieniającymi całkowicie jego charakter. <strong>Abażur</strong> w kształcie tuby z białego materiału to dość tradycyjne rozwiązanie. Wzbogacenie go jednak o chromowaną przyściankę oraz kaskadę <strong>kryształków</strong> nadało oprawie wyjątkowego uroku. To doskonały wybór do eleganckich salonów lub sypialni, do których zechcesz wprowadzić nieco luksusowej atmosfery.</p> <p align=\"justify\">Oprawy doskonale prezentują się pojedynczo oraz jako instalacje świetlne, tworząc niesamowite efekty podkreślające wyjątkowy wystrój i charakter Twoich pomieszczeń.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal / tkanina / kryształ <br />Wykończenie: chrom <br />Kolor: biały - przezroczysty (MBM1787/1 WH) / czarny - przezroczysty (MBM1787/1 BK)</p> <p><strong>Wymiary:</strong> <br /> Wysokość całkowita : 22 cm <br /> Szerokość: 13 cm <br />Głębokość (odległość od ściany): 18 cm <br /> Regulacja kąta światła: nie <br />Przewód z wtyczką: brak <br /> Włącznik: brak<br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','abazurowa-lampa-kinkiet-lana-mbm1787-1-wh-italux-kinkiet-oprawa-z-krysztalkami-glamour-crystal-tuba-biala','','','','Abażurowa LAMPA kinkiet LANA MBM1787/1 WH Italux kinkiet OPRAWA z kryształkami glamour crystal tuba biała','','','',''),(4,1,1,' <p align=\"justify\">Prezentowane oświetlenie w sklepie MLAMP.pl charakteryzuje się nowoczesnym i oryginalnym designem. Uniwersalne połączenie kolorów oraz wysokiej jakości materiały, sprawią, że wnętrze Twojego domu stanie się miejscem oryginalnym i komfortowym. Unikalna forma opraw oraz elementy dekoracyjne znajdą zastosowanie w każdym pomieszczeniu, dzięki czemu nabierze ono ponadczasowego charakteru.</p> <p align=\"justify\">Oprawy doskonale prezentują się pojedynczo oraz jako instalacje świetlne, tworząc niesamowite efekty podkreślające wyjątkowy wystrój i charakter Twoich pomieszczeń.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na trzy  źródła ś