na własny, domowy użytek. Trzeba jednak pamiętać o kilku ważnych aspektach: podczas działania urządzenia, należy <strong>bezwzględnie opuścić</strong> pomieszczenie, żaden człowiek ani zwierzę nie mogą być w jego zasięgu, ponieważ dłuższy kontakt może spowodować poparzenia skóry oraz oczu; należy pozostawić pomieszczenie zamknięte na co najmniej 40 minut podczas dezynfekowania. Lampa posiada dwa tryby dezynfekcji: ozonowy i nieozonowy. Przy dezynfekcji ozonowej pomieszczenie należy wietrzyć przez conajmniej 40 minut od zakończenia pracy lampy. Przy dezynfekcji nieozonowej pomieszczenie należy wietrzyć przez 20 minut. <br /><br />Lampa posiada w zestawie pilot, za pomocą którego możemy ustawić czas działania: 15, 30 lub 60 minut. Lampa posiada opóźnienie rozpoczęcia działania: 20 sekund.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal <br />Kolor: czarny</p> <p><strong>Wymiary:</strong> <br />Wysokość całkowita: 44 cm <br /> Szerokość: 17,5 cm <br />Regulacja kąta światła: nie <br />Stopień szczelności: </p> <p>Źródła światła (w komplecie): łącznie 36W (zainstalowany na stałe - niewymienny) / 230V<br /><br /></p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','antybakteryjna-lampa-stojaca-mdeco-ar-uv-dl-01-metalowa-oprawa-bakteriobojcza-do-dezynfekcji','','','','Antybakteryjna LAMPA stojąca MDECO AR-UV-DL-01 metalowa OPRAWA bakteriobójcza do dezynfekcji','','','',''),(156,1,1,' <p align=\"justify\">Prezentowana przez =mlamp.pl= oprawa to kinkiet, który wyróżnia się <strong>niezwykłą ozdobnością</strong>, świetnie współgrającą m.in. z aranżacjami Art Deco. Bazą oprawy jest szklany, półkolisty klosz, który zabudowano metalową kratką z kolorze starego srebra. W jej oczkach umieszczono kilkanaście okrągłych kryształków. Takie rozwiązanie podkreśla wszelkie walory wizualne, sprawiając, że Lucia to <strong>niepowtarzalna dekoracja</strong