troju, który wniesie do otoczenia aurę spokoju i przytulności.</p> <p align=\"justify\">Oprawy doskonale prezentują się pojedynczo oraz jako instalacje świetlne, tworząc niesamowite efekty podkreślające wyjątkowy wystrój i charakter Twoich pomieszczeń.</p> <p align=\"justify\">Lampa posiada miejsce na trzy źródła światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal <br />Kolor: biały</p> <p><strong>Wymiary:</strong> <br />Wysokość całkowita 130 cm <br /> Szerokość: 35 cm <br />Głębokość: 35 cm<br />Średnica klosza: 17 cm <br />Waga: 2,4 kg <br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 3 x E27 / 230V / max 60W (łącznie 180W) <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','biala-lampa-wiszaca-beryl-976er-aldex-metalowa-kaskada','','','','Biała lampa wisząca BERYL 976E_R Aldex metalowa kaskada','','','',''),(178,1,1,' <p align=\"justify\"><strong>Oprawa stołowa</strong> CHICAGO przypadnie do gustu miłośnikom nowoczesnych form. Wygięta nóżka przyciąga uwagę, stanowiąc ciekawe uzupełnienie iluminacji. Czarny abażur z tkaniny mieści jedną żarówkę z dużym gwintem, którą możesz dobrać w zależności od swoich preferencji. <strong>Lampa</strong> rozjaśni delikatną, miłą łuną światła stoliki nocne w sypialni podczas wieczornego relaksu z książką lub biurka w gabinetach, gdzie chcemy skupić się na pracy. CHICAGO, Poza funkcją praktyczną pełni też rolę uroczej dekoracji.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal | tkanina <br />Kolor: czarny (T0029) | biały (T0028) | chrom - biały (T0030)</p> <p><strong>Wymiary:</strong> <br />Wysokość całkowita : 46 cm <br /> Szerokość: 32 cm <br />Regulacja kąta światła: nie<br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 1 x E27 / 230V / max 100W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','biurkowa-abazurowa-lampka-stolowa-chicago-t0029-maxlight-klasyczna-lampa-nocna-do-sypialni-czarna','','','','Biurkowa abażurowa LAMPKA stołowa CHICAGO T0029 Maxlight klasyczna LAMPA nocna do sypialni czarna','','','',''),(179,1,1,' <p align=\"justify\">Szukasz oryginalnego oświetlenia do swojego domu? <strong>Lampa stołowa</strong> z kolekcji SAWA to właśnie to czego potrzebujesz. Szklana baza o nietypowym kształcie i przezroczystej strukturze, na której znajduje się złoty abażur to niezwykle stylowe rozwiązanie, nadające niepowtarzalnego charakteru każdej aranżacji. Oprawa należąca do oferty =mlamp.pl= stanowi niezwykły element dekoracyjny, który będzie się rewelacyjnie prezentował na stoliku nocnym w sypialni czy na komodzie w salonie lub przedpokoju.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: szkło | tkanina | metal <br />Kolor: złoty - przezroczysty (41013105) | beżowy - przezroczysty (41010107) | żółty - przezroczysty (41011114) | różowy - przezroczysty (41012116)</p> <p><strong>Wymiary:</strong> <br />Wysokość całkowita : 55 cm <br /> Szerokość podstawy: 35 cm <br />Średnica abażura: 38 cm<br />Wysokość abażura: 28 cm <br />Regulacja kąta światła: nie <br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 1 x E27 / 230V / max 60W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','biurkowa-lampa-abazurowa-sawa-velvet-41013105-kaspa-stolowa-lampka-stojaca-nocna-do-sypialni-przezroczysta-zlota','','','','Biurkowa LAMPA abażurowa SAWA VELVET 41013105 Kaspa stołowa LAMPKA stojąca nocna do sypialni przezroczysta złota','','','',''),(180,1,1,' <p align=\"justify\">Dobra <strong>lampka biurkowa</strong> to obowiązkowy element każdego biura. Tylko z dobrym oświetleniem praca może stawać się efektywniejsza, a nawet przyjemniejsza. Dlatego też =mlamp.pl= prezentuje lampkę biurkową Bank. Ta, dzięki <strong>klasycznej</strong>, ale wciąż niezwykle gustownej oprawie doskonale sprawdzi się również w roli <strong>dekoracji</strong>, która wprowadzi do pomieszczenia niepowtarzalny klimat i sprawi, że to będzie wyglądać jeszcze bardziej profesjonalnie, co zapewni również stonowana kolorystyka.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal | szkło <br />Kolor: satynowy chrom - biały (4037) | brąz - zielony (4038)</p> <p><strong>Wymiary:</strong> <br />Wysokość całkowita : 33 cm <br /> Szerokość: 27 cm <br />Waga: 2,4 kg <br />Regulacja kąta światła: nie <br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 1 x E27 / 230V / max 60W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','biurkowa-lampa-industrialna-bank-4037-rabalux-metalowa-lampka-stojaca-dekoracyjna-bankierska-satynowy-chrom-biala','','','','Biurkowa LAMPA industrialna BANK 4037 Rabalux metalowa LAMPKA stojąca dekoracyjna bankierska satynowy chrom biała','','','',''),(181,1,1,' <p align=\"justify\">Jeżeli jesteś w trakcie poszukiwania nowej <strong>lampy stołowe