ęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','biurkowa-lampa-skandynawska-sardo-tb-5581-1-scsg-italux-loftowa-lampka-szklana-tuba-biurkowa-stojaca-nikiel-przydymiona','','','','Biurkowa LAMPA skandynawska SARDO TB-5581-1-SC+SG Italux loftowa LAMPKA szklana tuba biurkowa stojąca nikiel przydymiona','','','',''),(185,1,1,' <p align=\"justify\"><strong>Lampa stołowa</strong> z kolekcji BANKIER to doskonałe rozwiązanie, które rewelacyjnie sprawdzi się zarówno w młodzieżowym pokoju na biurku czy w gabinecie, a nawet na komodzie w salonie bądź nocnej szafce w sypialni. <strong>Prosta podstawa oraz klosz</strong> oferowanej przez =mlamp.pl= iluminacji wykonane zostały z metalu. <strong>Minimalistyczna konstrukcja</strong> nawiązująca do geometrycznej prostoty sprawdzi się w wielu aranżacjach.</p> <p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p> <p><strong>Specyfikacja:</strong> <br />Materiały: metal <br />Kolor: szary (41-78339) | miedziany (41-78346)</p> <p><strong>Wymiary:</strong> <br />Wysokość całkowita : 36 cm <br /> Szerokość: 24 cm x 16,5 cm <br />Regulacja kąta światła: nie <br />Stopień szczelności: IP20</p> <p>Źródła światła (brak w komplecie): 1 x E14 / 230V / max 40W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p> <p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p> ','','biurkowa-lampa-stojaca-bankier-41-78339-candellux-stolowa-lampka-gabinetowa-metalowa-szara','','','','Biurkowa LAMPA stojąca BANKIER 41-78339 Candellux stołowa LAMPKA gabinetowa metalowa szara','','','',''),(186,1,1,' <p align=\"justify\">Jeśli szukasz naprawdę <strong>wyjątkowej lampki</strong> , która zarazem sprawdzi się jako <strong>ciekawy gadżet</strong> to =mlamp.pl= pragnie przedstawić