>nieodłączny element</strong> pałacowych wnętrz, więc jeśli chcesz przenieść część tego świata do swoich czterech ścian to oferowana przez =mlamp.pl= stołowa lampka z pewnością Ci to ułatwi. Połączenie surowego charakteru mosiężnej podstawy z <strong>delikatnością szła</strong> daje wyjątkową dekorację, obok której nikt nie zdoła przejść obojętnie. Umieszczona w odpowiednim miejscu może być zarówno funkcjonalną oprawą, jak i <strong>głównym elementem</strong> każdej aranżacji.</p><p align=\"justify\">Prezentowana lampa posiada miejsce na jedno źródło światła.</p><p><strong>Specyfikacja:</strong> <br />Materiały: metal | szkło <br />Kolor: mosiądz - przezroczysty (ELM6246/1D 21QG+TR) | chrom - przezroczysty (ELM6246/1D 8C) | mosiądz - bursztynowy (ELM6246/1D 21QG ) | złoty - przezroczysty (ELM6246/1D TR)</p><p><strong>Wymiary:</strong> <br />Wysokość całkowita : 50 cm <br /> Szerokość: 32 cm <br />Waga: 4,5 kg <br />Regulacja kąta światła: nie <br />Stopień szczelności: IP20</p><p>Źródła światła (brak w komplecie): 1 x E27 / 230V / max 60W <br />Oprawa dostosowana jest do źródeł światła o klasach energetycznych od A++ do E oraz żarówek LED o dowolnej mocy.</p><p>Produkt posiada certyfikaty zgodności i objęty jest GWARANCJĄ PRODUCENTA. <br />Zestaw zawiera instrukcję obsługi oraz elementy niezbędne do złożenia sprzętu.</p>','','biurkowa-lampa-stojaca-elm6246-1d-21qgtr-mdeco-szklana-lampka-glamour-stolowa-z-krysztalkami-mosiadz-przezroczysta','','','','Biurkowa LAMPA stojąca ELM6246/1D 21QG+TR MDECO szklana LAMPKA glamour stołowa z kryształkami mosiądz przezroczysta','','','',''),(188,1,1,' <p align=\"justify\">Polecana przez <strong>=mlamp.pl=</strong>, nietypowa <strong>lampa stołowa</strong> to nowa odsłona oświetlenia, które pragniemy Ci przedstawić! Oprawa wykonana jest z <strong>metalowego</strong> szkieletu o cudownym, <strong>białym</strong> kolorze, które perfekcyjnie ukazuje wnętrze <strong>lampy</strong>. Takie rozwiązanie pozwala na uwidocznienie żarówki, k